"use strict";
const { Model } = require("sequelize");
module.exports = (sequelize, DataTypes) => {
  class Treatment extends Model {
    /**
     * Helper method for defining associations.
     * This method is not a part of Sequelize lifecycle.
     * The `models/index` file will call this method automatically.
     */
    static associate(models) {
      Treatment.belongsTo(models.MedicalPackage, {
        foreignKey: "medicalpackageId",
        targetKey: "id",
        as: "medicalPackageDataToTreatment",
      });

      Treatment.hasMany(models.Diet, {
        foreignKey: "treatmentId",
        as: "treatmentDataToDiet",
      });

      Treatment.hasMany(models.ExerciseMode, {
        foreignKey: "treatmentId",
        as: "treatmentDataToExerciseMode",
      });
    }
  }
  Treatment.init(
    {
      method: DataTypes.STRING,
      note: DataTypes.TEXT,
      medicalpackageId: DataTypes.STRING,
    },
    {
      sequelize,
      modelName: "Treatment",
    }
  );
  return Treatment;
};

