      // });
      // Treatment.hasMany(models.TreatmentMedical, {
      //   foreignKey: "treatmentId",
      //   as: "treatmentDataToTreatmentMedical",
      // });
    }
  }
  Treatment.init(
    {
      method: DataTypes.STRING,
