const mealtimeService = require("../services/mealtimeService");

let handleCreateNewMealtime = async (req, res) => {
  let mealtime = await mealtimeService.createNewMealtime(req.body);
  return res.status(200).json(mealtime);
};

let handleEditMealtime = async (req, res) => {
  let data = req.body;
  let message = await mealtimeService.updateMealtime(data);
  return res.status(200).json(message);
};

let handleDeleteMealtime = async (req, res) => {
  if (!req.body.id) {
    return res.status(200).json({
      code: 1,
      message: "Error",
    });
  }
  let message = await mealtimeService.deleteMealtime(req.body.id);
  return res.status(200).json(message);
};

module.exports = {
  handleCreateNewMealtime: handleCreateNewMealtime,
  handleEditMealtime: handleEditMealtime,
  handleDeleteMealtime: handleDeleteMealtime,
};

